// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/utils/Base64.sol";

/**
 * @title ZKStampsPOAP
 * @dev ERC721 token representing Proof of Attendance Protocol for travel destinations
 */
contract ZKStampsPOAP is ERC721, ERC721URIStorage, Ownable {
    using Counters for Counters.Counter;
    using Strings for uint256;

    Counters.Counter private _tokenIdCounter;

    // Structure to store POAP data
    struct POAPData {
        string countryCode;
        string countryName;
        int256 latitude;
        int256 longitude;
        uint256 timestamp;
        address owner;
    }

    // Mapping from token ID to POAP data
    mapping(uint256 => POAPData) private _poapData;

    // Mapping from owner to their POAP tokens
    mapping(address => uint256[]) private _ownerPOAPs;

    // Mapping to track if a user has already minted a POAP for a country
    mapping(address => mapping(string => bool)) private _countryVisited;

    // Events
    event POAPMinted(
        address indexed recipient, 
        uint256 indexed tokenId, 
        string countryCode, 
        int256 latitude, 
        int256 longitude
    );

    constructor() ERC721("zkStamps Travel POAP", "ZKSTAMP") {}

    /**
     * @dev Mints a new POAP token
     * @param recipient Address of the token recipient
     * @param countryCode Country code (e.g., "US", "JP")
     * @param countryName Full country name
     * @param coordinates Array with [latitude, longitude] as scaled integers
     * @param timestamp Time of the visit
     * @return uint256 ID of the minted token
     */
    function mintPOAP(
        address recipient,
        string memory countryCode,
        string memory countryName,
        int256[2] memory coordinates,
        uint256 timestamp
    ) public onlyOwner returns (uint256) {
        // Check if the user has already minted a POAP for this country
        require(!_countryVisited[recipient][countryCode], "ZKStampsPOAP: User already has a POAP for this country");

        // Get the next token ID
        uint256 tokenId = _tokenIdCounter.current();
        _tokenIdCounter.increment();

        // Mint the token
        _safeMint(recipient, tokenId);

        // Store the POAP data
        _poapData[tokenId] = POAPData({
            countryCode: countryCode,
            countryName: countryName,
            latitude: coordinates[0],
            longitude: coordinates[1],
            timestamp: timestamp,
            owner: recipient
        });

        // Add the token to the owner's collection
        _ownerPOAPs[recipient].push(tokenId);

        // Mark this country as visited by the user
        _countryVisited[recipient][countryCode] = true;

        // Generate and set the token URI
        _setTokenURI(tokenId, _generateTokenURI(tokenId));

        // Emit the event
        emit POAPMinted(recipient, tokenId, countryCode, coordinates[0], coordinates[1]);

        return tokenId;
    }

    /**
     * @dev Checks if a user has already minted a POAP for a specific country
     * @param owner Address of the user
     * @param countryCode Country code to check
     * @return bool True if the user has already visited this country
     */
    function hasVisitedCountry(address owner, string memory countryCode) public view returns (bool) {
        return _countryVisited[owner][countryCode];
    }

    /**
     * @dev Gets all POAP tokens owned by a specific address
     * @param owner Address to query
     * @return uint256[] Array of token IDs
     */
    function getPOAPsByOwner(address owner) public view returns (uint256[] memory) {
        return _ownerPOAPs[owner];
    }

    /**
     * @dev Gets POAP data for a specific token
     * @param tokenId ID of the token to query
     * @return POAPData Struct containing the POAP data
     */
    function getPOAPData(uint256 tokenId) public view returns (POAPData memory) {
        require(_exists(tokenId), "ZKStampsPOAP: Query for nonexistent token");
        return _poapData[tokenId];
    }

    /**
     * @dev Checks if a token exists
     * @param tokenId ID of the token to check
     * @return bool True if the token exists
     */
    function _exists(uint256 tokenId) internal view override returns (bool) {
        return _ownerOf(tokenId) != address(0);
    }

    /**
     * @dev Generates a token URI with embedded metadata
     * @param tokenId ID of the token
     * @return string The token URI with embedded metadata
     */
    function _generateTokenURI(uint256 tokenId) internal view returns (string memory) {
        POAPData memory data = _poapData[tokenId];

        // Scale back the coordinates from integers to floats for display
        // Division is integer division, so this is an approximation
        string memory latitudeStr = _formatCoordinate(data.latitude, 7);
        string memory longitudeStr = _formatCoordinate(data.longitude, 7);

        // Create JSON metadata
        string memory json = Base64.encode(
            bytes(
                string(
                    abi.encodePacked(
                        '{"name": "Travel POAP - ', data.countryName, '", ',
                        '"description": "Proof of travel to ', data.countryName, ' verified by zkStamps", ',
                        '"attributes": [',
                            '{"trait_type": "Country", "value": "', data.countryName, '"}, ',
                            '{"trait_type": "Country Code", "value": "', data.countryCode, '"}, ',
                            '{"trait_type": "Latitude", "value": "', latitudeStr, '"}, ',
                            '{"trait_type": "Longitude", "value": "', longitudeStr, '"}, ',
                            '{"trait_type": "Timestamp", "value": "', data.timestamp.toString(), '"}, ',
                            '{"trait_type": "Minted", "value": "', block.timestamp.toString(), '"}',
                        ']',
                        '}'
                    )
                )
            )
        );

        return string(abi.encodePacked("data:application/json;base64,", json));
    }

    /**
     * @dev Formats a coordinate from scaled integer back to a string representation
     * @param coordinate The coordinate as a scaled integer
     * @param decimals Number of decimal places in the scaling
     * @return string The formatted coordinate as a string
     */
    function _formatCoordinate(int256 coordinate, uint8 decimals) internal pure returns (string memory) {
        // Handle negative values
        bool isNegative = coordinate < 0;
        uint256 absValue = uint256(isNegative ? -coordinate : coordinate);

        // Calculate the scaling factor
        uint256 scalingFactor = 10**decimals;

        // Get the whole part and decimal part
        uint256 wholePart = absValue / scalingFactor;
        uint256 decimalPart = absValue % scalingFactor;

        // Convert to string, handling leading zeros in decimal part
        string memory decimalStr = decimalPart.toString();
        uint256 decimalLength = bytes(decimalStr).length;

        // Add leading zeros if needed
        string memory leadingZeros = "";
        if (decimalLength < decimals) {
            for (uint8 i = 0; i < decimals - decimalLength; i++) {
                leadingZeros = string(abi.encodePacked(leadingZeros, "0"));
            }
        }

        // Combine parts with appropriate sign
        return string(
            abi.encodePacked(
                isNegative ? "-" : "",
                wholePart.toString(),
                ".",
                leadingZeros,
                decimalStr
            )
        );
    }

    // The following functions are overrides required by Solidity

    function _burn(uint256 tokenId) internal override(ERC721, ERC721URIStorage) {
        super._burn(tokenId);
    }

    function tokenURI(uint256 tokenId) public view override(ERC721, ERC721URIStorage) returns (string memory) {
        return super.tokenURI(tokenId);
    }

    function supportsInterface(bytes4 interfaceId) public view override(ERC721, ERC721URIStorage) returns (bool) {
        return super.supportsInterface(interfaceId);
    }
}

